import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';

export default function Home() {
  const [questions, setQuestions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const { user } = useAuth();

  useEffect(() => {
    const fetchQuestions = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/questions');
        setQuestions(response.data);
      } catch (error) {
        setError('Failed to fetch questions');
      } finally {
        setLoading(false);
      }
    };

    fetchQuestions();
  }, []);

  const handleVote = async (questionId, voteType) => {
    if (!user) {
      setError('Please log in to vote');
      return;
    }

    try {
      const response = await axios.post(`http://localhost:5000/api/questions/${questionId}/vote`, {
        voteType
      });
      
      // Update the questions list with the updated question
      setQuestions(questions.map(q => 
        q._id === questionId ? response.data : q
      ));
    } catch (error) {
      setError('Failed to vote');
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-900">
        <div className="text-white text-xl">Loading...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-gray-900">
        <div className="text-red-500 text-xl">{error}</div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-900 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center mb-8">
          <h1 className="text-3xl font-bold text-white">Questions</h1>
          <Link
            to="/ask"
            className="btn btn-primary"
          >
            Ask Question
          </Link>
        </div>

        <div className="space-y-6">
          {questions.map((question) => (
            <div key={question._id} className="card">
              <div className="flex items-start space-x-4">
                <div className="flex flex-col items-center space-y-2">
                  <button
                    className="text-gray-400 hover:text-primary-500"
                    onClick={() => handleVote(question._id, 'upvote')}
                  >
                    <svg
                      className="h-6 w-6"
                      fill="none"
                      stroke="currentColor"
                      viewBox="0 0 24 24"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M5 15l7-7 7 7"
                      />
                    </svg>
                  </button>
                  <span className="text-white font-medium">
                    {question.upvotes.length - question.downvotes.length}
                  </span>
                  <button
                    className="text-gray-400 hover:text-primary-500"
                    onClick={() => handleVote(question._id, 'downvote')}
                  >
                    <svg
                      className="h-6 w-6"
                      fill="none"
                      stroke="currentColor"
                      viewBox="0 0 24 24"
                    >
                      <path
                        strokeLinecap="round"
                        strokeLinejoin="round"
                        strokeWidth={2}
                        d="M19 9l-7 7-7-7"
                      />
                    </svg>
                  </button>
                </div>
                <div className="flex-1">
                  <Link
                    to={`/questions/${question._id}`}
                    className="text-xl font-medium text-white hover:text-primary-500"
                  >
                    {question.title}
                  </Link>
                  <p className="mt-2 text-gray-400 line-clamp-2">{question.content}</p>
                  <div className="mt-4 flex items-center space-x-4 text-sm text-gray-400">
                    <span>Asked by {question.author.name}</span>
                    <span>•</span>
                    <span>{new Date(question.createdAt).toLocaleDateString()}</span>
                    <span>•</span>
                    <span>{question.answers.length} answers</span>
                    <span>•</span>
                    <span>{question.views} views</span>
                  </div>
                  <div className="mt-4 flex flex-wrap gap-2">
                    {question.tags.map((tag) => (
                      <span
                        key={tag}
                        className="px-2 py-1 text-xs font-medium bg-gray-700 text-gray-300 rounded-full"
                      >
                        {tag}
                      </span>
                    ))}
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
